import Modal from "./components/modal/modal";
import ReactSlider from "./components/slider/slider";
import CountDown from "./components/count_down/count_down";
import AppLoader from "./components/app_loader/app_loader";

export default {
  Card,
  Anim,
  Header,
  Window,
  Modal,
  ReactSlider,
  CountDown,
  AppLoader,
